    "translation": [
        "tr.en: x my house, suitable for rule,",
        "tr.en: x my house of libated syrup and ghee,",
        "tr.en: x the woman’s abode of my childhood maiden (years), no longer filled with your charms: I am the one who would carry your tears!",
        "tr.en: I am the one who would carry your tears! Your tears do not cease, my heart is not assuaged.",
        "tr.en: Because of this, the lamenter is at the ready (and) does not sleep.",
        "tr.en: Like the dagger-wielding ecstatic, (s)he does not approach?.",
        "tr.en: Like the changing pi-li-pi-li, (s)he went along(?) the public square.",
        "tr.en: The maiden(?) lets her hair hang loosely backwards. A good […]",
        "tr.en: … began to wail …",
        "tr.en: … he destroyed your city. … the house(?) …",
        "tr.en: […] he destroyed the house of(?) Enki(?) …",
        "tr.en: … he seized(?) their hands.",
        "tr.en: … the princely rites …",
        "tr.en: … made, … at the side of the wall.",
        "tr.en: My …, the eternal command of the great gods.",
        "tr.en: Lord Enlil, lord of the lands,",
        "tr.en: Looked maliciously at Sumer, devastated it with a flood-storm.",
        "tr.en: He destroyed Kiur, the great place.",
        "tr.en: “My beloved, for how long was it built? For how long is it destroyed? … adornment of the Abzu.”",
        "tr.en: Its gešgigal.",
        "tr.en: “Lord Enki, who has seen a destruction (like that) of your city Eridu?",
        "tr.en: Who has seen a misfortune like that of the Abzu shrine, your house?",
        "tr.en: No one goes up to your cultic place.",
        "tr.en: At the afternoon meal, in his great dining hall, they do not call his name.”",
        "tr.en: Enki, king of the abzu,",
        "tr.en: felt distresssed, felt anxious. At the words of his spouse,",
        "tr.en: he himself began to wail, and lay down fasting.",
        "tr.en: “My king, you must not be distressed, you must not be anxious!”"
    ],
